// загружает API Яндекс карт
function loadYandexMapAPI(callback) {
  const script = document.createElement('script');
  script.src = 'https://api-maps.yandex.ru/2.1/?apikey=8c50b945-d9f7-4bf3-96f7-49dc0772c9bf&lang=ru_RU';
  script.onload = callback;
  document.head.appendChild(script);
}

// возвращает значение объекта по найденным ключам
function getObjByKeys (obj, keys) { 
  keys.reduce((acc, key) => {
    if (acc && acc.hasOwnProperty(key)) {
      return acc[key];
    } else {
      return false;
    }
  }, obj);
}

// создает html-шаблон маркера компании
function companyMarkerTemplate (ymaps, company) {
  if (!ymaps) {
    return null;
  }

  const template = ymaps.templateLayoutFactory.createClass(`
    <div class="company-marker js-company-marker">
      <div class="company-marker__logo">
        ${company.logo ? company.logo : ''}
      </div>
    </div>`, {
    build: function() {
      template.superclass.build.call(this);
    },
  });
  
  return template;
}

// создает html-шаблон кластера
function clusterMarkerTemplate (ymaps) {
  const template = ymaps.templateLayoutFactory.createClass(
    `<div class="cluster-marker">
        {{ properties.geoObjects.length }}
    </div>`, {
    build: function() {
        template.superclass.build.call(this);
    },
  });

  return template;
}

// создает html-шаблон партнерского маркера
function partnerMarkerTemplate (ymaps, partner) {
  if (!ymaps) {
    return;
  }

  const template = ymaps.templateLayoutFactory.createClass(`
    <div class="partner-marker js-partner-marker">
      <div class="partner-marker__pin">
        ${partner.icon_content ? partner.icon_content : ''}
      </div>
    </div>`, {
      build: function() {
        template.superclass.build.call(this);
      },
  });

  return template;
}

// создает маркер компании
function generateCompanyMarker (ymaps, company, active = false, disableEvents = false ) {
  // размер маркера
  const sizes = [68, 68];

  return {
    // географический объект для отображения на карте
    type: 'Feature',
    id: company.id,
    // объект типа "точка" с координатами
    geometry: {
      type: 'Point',
      coordinates: company.coords,
    },
    properties: {
      id: company.id,
      name: company.name,
    },
    options: {
      // внешний вид маркера
      iconLayout: companyMarkerTemplate(ymaps, company),
      // смещение маркера
      iconOffset: [-sizes[0] / 2, -sizes[1] / 2],
      coordinates: [
        [0, 0], sizes
      ],
      // слой отображения маркера
      pane: 'overlaps',
      // активность маркера
      active: active,
      // отключение событий
      disableEvents: disableEvents,
    }
  }
}

// создает партнерский маркер
function generatePartnerMarker (ymaps, partner = {}, active=false) {
  const sizes = [36, 36];

  return {
    type: 'Feature',
    id: partner.id,
    geometry: {
      type: 'Point',
      coordinates: partner.coords,
    },
    properties: {
      id: partner.id,
      name: partner.name,
    },
    options: {
      iconLayout: partnerMarkerTemplate(ymaps, partner),
      iconOffset: [-sizes[0] / 2, -sizes[1] / 2],
      // прямоугольная область для события маркера
      iconShape: {
        type: 'Rectangle',
        coordinates: [
          [0, 0], sizes,
        ],
      },
      active: active,
    },
  }
}

function addOffice () {
 if (!company.coords || !map) {
  return;
 }

 // создает объект
 companyObjectManager = new ymaps.ObjectManager({});

 // создает маркер
 const companyMarker = generateCompanyMarker(ymaps, company, true, true);

 // добавляет маркер в объект
 companyObjectManager.add(companyMarker);

 // добавляет объект на карту
 map.geoObjects.add(companyObjectManager);
}

function addPartners () {
  if (!map) {
    return;
  }

  partnersObjectManager = new ymaps.ObjectManager({
    // группировка в кластеры, если объектов слишком много
    // кластер - круг с числом - количеством объектов 
    clusterize: true,
    // минимальное количество объектов для формирования кластера
    minClusterSize: 2,
    // смещение значка кластера
    clusterIconOffset: [0, 0],
    // форма и размер значка кластера
    clusterIconShape: {
      type: 'Circle',
      coordinates: [0, 0],
      radius: 18,
    },
    // дополнительный отступ от границы карты при масштабировании
    zoomMargin: 48,
    // html-шаблон для кластера
    clusterIconLayout: clusterMarkerTemplate(ymaps),
    // кластер не имеет всплывающего баллона
    clusterHasBallon: false,
  });

  // создание маркеров партнерских компаний
  partners.forEach(partner => {
    const marker = generatePartnerMarker(ymaps, partner, false);
    partnersObjectManager.add(marker);
  })

  // добавление партнерских маркеров на карту
  map.geoObjects.add(partnersObjectManager);

  partnersObjectManager.objects.events
    .add(['mouseenter'], e => {

    })
    .add(['mouseleave'], e => {

    })
    .add('click', e => {

    });
}

